import React from "react";
import NavigationBar from "../../components/NavigationBar";

const Home = () => {
  return (
    <>
      <div className="container-fluid" style={{ height: "100vh" }}>
        <NavigationBar />
        <div className="container">
          <div className="row">
            <div className="col-lg-12 col-md-12 col-sm-12">
              <div>
                <input type="text" />
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
